import PropTypes from 'prop-types';
const itemsPropTypes = { 
    items: PropTypes.arrayOf(
        PropTypes.shape({
            id: PropTypes.string,
            title: PropTypes.string.isRequired,
            stats: PropTypes.number,
        })
    ) 
}
export default itemsPropTypes
